import React from "react"
import {TextField} from "@material-ui/core"


export const CustomField = ({setFieldValue, ...props}) => {
    return <TextField
        fullWidth
        focused={false}
        variant='outlined'
        onChange={e => setFieldValue(props.name, e)}
        {...props}
    />
};
